const findMaximumXOR = (nums, maximumBit) => {
    let n = nums.length;
    let prefixXOR = new Array(n + 1).fill(0);
    for (let i = 0; i < nums.length; i++) {
        prefixXOR[i + 1] = prefixXOR[i] ^ nums[i];
    }
    let result = [];
    for (let x of prefixXOR.slice(1).reverse()) {
        let maxBit = 0;
        for (let i = 0; i < maximumBit; i++) {
            if (((x >> i) & 1) == 0) {
                maxBit |= 1 << i;
            }
        }
        result.push(maxBit);
    }
    return result;
}
```
